package main

import (
	"fmt"
	"math"
)

func numberOfSubstringsBruteForce(s string) int {
	n := len(s)
	countOnes := make([]int, n)
	curr := 0
	for i := range s {
		if s[i] == '1' {
			curr++
		}
		countOnes[i] = curr
	}
	ans := 0
	for i := range n {
		for j := i; j < n; j++ {
			currOnes := countOnes[j]
			if i-1 >= 0 {
				currOnes -= countOnes[i-1]
			}
			countZeros := j - i + 1 - currOnes
			if currOnes >= countZeros*countZeros {
				ans++
			}

		}
	}
	return ans
}

func numberOfSubstrings(s string) int {
	n := len(s)
	countOnes := make([]int, n)
	curr := 0
	for i := range s {
		if s[i] == '1' {
			curr++
		}
		countOnes[i] = curr
	}
	ans := 0
	for i := range n {
		for j := i; j < n; j++ {
			currOnes := countOnes[j]
			if i-1 >= 0 {
				currOnes -= countOnes[i-1]
			}
			currZeros := j - i + 1 - currOnes
			if currOnes < (currZeros * currZeros) {
				wasteIndx := (currZeros * currZeros) - currOnes
				j += wasteIndx - 1
			} else if currOnes == (currZeros * currZeros) {
				ans += 1
			} else {
				ans += 1

				k := int(math.Sqrt(float64(currOnes))) - currZeros
				nextJ := j + k

				if nextJ >= n {
					ans += (n - j - 1)
					break
				} else {
					ans += k
				}

				j = nextJ
			}
		}
	}
	return ans
}

func main() {
	s := ""
	// fmt.Println(numberOfSubstringsBruteForce(s))
	fmt.Println(numberOfSubstrings(s))
}
